# Oboda, Republic of Dagestan

}}
Oboda () is a rural locality (a selo) and the administrative center of Obodinsky Selsoviet, Khunzakhsky District, Republic of Dagestan, Russia. Population:  There are 22 streets in this selo.
Geography
It is located 5&nbsp;km from Khunzakh (the district's administrative centre), 81&nbsp;km from Makhachkala (capital of Dagestan) and 1,642&nbsp;km from Moscow. Ebuta is the nearest rural locality.
